import React from 'react'
import './App.css';
import {DataCharacters} from './DataCharacters'
import {BtnStaf} from './Components/BtnStaff'

function App() {
  return (
    <>
      <header>
        <BtnStaf />

      </header>
      <div className="App">
        <DataCharacters />
      </div>
    </>
  );
}

export default App;
